import styled from "styled-components";

type ButtonPropsType = {
  bgcolor?: string
}

export const Button =styled.button<ButtonPropsType>`
  color: #FFFEFD;
font-size: 18px;
font-weight: 600;
max-width: 182px;
height: 52px;

`
